uje vonkajšiu reklamu. Okrem toho môže tiež pomôcť informovať a vzdelávať verejnosť o stavebnom projekte vrátane časového harmonogramu projektu, rozsahu a zainteresovaných strán.	ON_REQUEST	\N	0.20	t	2026-01-21 09:36:21.878	2026-01-24 19:22:45.11	1456	t	f
